import React, { Component } from "react";
import { Link,NavLink } from "react-router-dom"
import "../comps_css/super.css"

class Nav extends Component {

    render() {
        return (
            <nav className="container-fluid">
                <div className="container p-2 d-flex align-items-center justify-content-center">
                    <div>
                        {/* <Link to="/cat/food" >Food</Link>
                        <Link to="/cat/animals" >Animals</Link>
                        <Link to="/cat/clothing" >Clothing</Link>
                        <Link to="/" >All</Link> */}

                        <NavLink to="/cat/food" activeStyle ={{background:"lightskyblue"}} className ="text-decoration-none">Food</NavLink>
                        <NavLink to="/cat/animals" activeStyle ={{background:"lightskyblue"}} className ="text-decoration-none">Animals</NavLink>
                        <NavLink to="/cat/clothing" activeStyle ={{background:"lightskyblue"}} className ="text-decoration-none">Clothing</NavLink>
                        <NavLink exact to="/" activeStyle ={{background:"lightskyblue"}} className ="text-decoration-none">All</NavLink>

                    </div>
                </div>

            </nav>


        )
    }
}

export default Nav;
